Let's define an Event struct in a Sway contract: struct Event { address: Address, id: u64, block_height: u64,
} Our GraphQL schema should resemble: type Event { id: ID! account: Address! @indexed block_height: Int8! @indexed
} This will generate the following Postgres schema: Table "schema.event" Column | Type | Collation | Nullable | Default | Storage | Compression | Stats target | Description -----------+-------------+-----------+----------+---------+----------+-------------+--------------+------------- id | bigint | | not null | | plain | | | count | bigint | | not null | | plain | | | address | varchar(64) | | not null | | plain | | | object | bytea | | not null | | extended | | | Indexes: "count_pkey" PRIMARY KEY, btree (id)
Access method: heap The source code for these types can be found here .
